  \"2015-09-26T20:51:54.324139\",\n\t\"name\": \"2005-hurricane-katrina-response-imagery\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a single image tile from
  a collection of GeoTIFF format natural color image tiles that cover regions of Alabama,
  Louisiana, and Mississippi that were affected by Hurricane Katrina in August 2005.
  The raw imagery used to generate the final image tiles was collected simultaneously
  with airborne GPS and IMU data, which was used to georeference the raw imagery.
  The raw imagery was rectified to a plane of constant elevation. and mosaicked to
  generate the final image tiles. Each image tile provides data for a nominal 1.875
  minute (in latitude and longitude) cell area. The source imagery was obtained in
  September 2005 and used to produce georeferenced, planar rectified imagery with
  a one foot ground resolution. Imagery was acquired at one foot ground sample distance
  (GSD) resolution. Flight height maintained during mission was 10,000 feet AGL. The
  imagery was captured at 12-bit radiometric resolution and converted to 8-bit radiometric
  resolution during post processing. The imagery was obtained and processed by all
  digital means beginning with data acquisition using an ADS40 digital airborne sensor.
  The orthophotos are available in GeoTIFF form in Geographic Coordinates (decimal
  degrees), NAD83.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
